import React from "react";
import "./styles.css";

function Footer() {
  return (
    <div style={{ marginTop: "20%" }} className="Footer">
      <div
        style={{
          width: "150px",
          height: "150px",
          justifyContent: "space-around",
          alignItems: "center",
          display: "flex",
          flexDirection: "column",
        }}
      >
        <img
          alt="school logo"
          src={require("../Icons/logo white.png")}
          style={{ maxWidth: "100%", maxHeight: "100%" }}
        />
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "flex-end",
          justifyContent: "space-around",
        }}
      >
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "flex-end",
            justifyContent: "center",
          }}
        >
          <span style={{ fontSize: "30px" }} className="DevanshiBipinGanatra">
            Devanshi Bipin Ganatra
          </span>
          <span style={{ fontSize: "20px" }} className="FullStackEngineer">
            FULL STACK ENGINEER
          </span>
        </div>
        <div style={{marginTop: "10%"}}>
          <span style={{}}>Find me on:</span>
          <span><a href=""><img alt="LinkedInIcon" src={require("../Icons/Icons-16.png")} style={{maxWidth:"100%", maxHeight:"100%"}}/></a></span>
        </div>
      </div>
    </div>
  );
}

export default Footer;
